import Content from "./components/Content";
import { styles } from "./App.styles";
import { GoalContext, defaultState } from "./GoalContext";
import { useState } from "react";

export function App(): JSX.Element {
  const [price, setPrice] = useState(defaultState.price);
  const [date, setDate] = useState(defaultState.date);
  const [monthlyAmount, setMonthlyAmount] = useState(
    defaultState.monthlyAmount
  );

  return (
    <GoalContext.Provider
      value={{
        price,
        setPrice,
        date,
        setDate,
        monthlyAmount,
        setMonthlyAmount,
      }}>
      <div data-testid="greetings-container" style={styles.title}>
        Let's plan your <strong>saving goal</strong>
      </div>
      <div style={styles.contant}>
        <Content />
      </div>
    </GoalContext.Provider>
  );
}
